import collections


class LongestDuplicateSubstring:
    def longestDupSubstring(self, S: str) -> str:
        if not S:
            return ""
        chars = collections.defaultdict(int)
        max_count = 0
        max_index = -1
        for i, c in enumerate(S):
            if c in chars:
                prec = S[i - 1]
                chars[c] = chars[prec] + 1
                if max_count < chars[c]:
                    max_count = chars[c]
                    max_index = i
            else:
                chars[c] = 0

        if max_count == 0:
            return ""
        else:
            start = max_index - max_count + 1
            end = max_index + 1
            return S[start:end]


if __name__ == '__main__':
    init = LongestDuplicateSubstring()
